import React, { useState }from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Container,Paper,Button } from '@mui/material';

export default function Duenio() {
    const paperStyle={padding:'50px 20px ', width:600,margin: "20px auto"}
    const [name, setname] = useState('');
    const [num, setnum] = useState('');
    const [direc, setdirec] = useState('');
    const [cant, setcant] = useState('');

    //Fucnión cuando agregen datos al formulario
    const handleClick=(e)=>{
        e.preventDefault();
        const duenio={name,num,direc,cant}
        console.log(duenio);
        fetch("http://localhost:8080/duenio/add",{
            method:"POST",
            headers:{"Content-Type":"application/json"},
            body:JSON.stringify(duenio)
        }).then
    }
  return (
    <Container>
        <Paper elevation={3} style={paperStyle}>
            <h1 style={{color:"blue"}} > Agregar un Dueño </h1>
        <Box
        component="form"
        sx={{
            '& > :not(style)': { m: 1},
        }}
        noValidate
        autoComplete="off"
        >
        <TextField id="standard-basic" label="Nombre" variant="standard" fullWidth value={name} onChange={(e)=>setname(e.target.value)} />
        <TextField id="standard-basic" label="Numero" variant="standard" fullWidth value={num} onChange={(e)=>setnum(e.target.value)}/>
        <TextField id="standard-basic" label="Cant Mascotas" variant="standard" fullWidth value={cant} onChange={(e)=>setcant(e.target.value)} />
        <TextField id="standard-basic" label="Dirección" variant="standard" fullWidth value={direc} onChange={(e)=>setdirec(e.target.value)}/>
        <Button variant="contained" onClick={handleClick}>
        Enviar 
        </Button>
        
        </Box>
        </Paper>
    </Container>
  );
}
